function Input (){
    const [text,setText] = useState("")

    const onch = (event)=> {
        const t = event.target.value
        setText(t)
        
    }

    return(
        <div>
            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
            <hr></hr>
            <p>Você clicou {count} vezes</p>
            <button onClick={() => setCount(count + 1)}>
                Clique aqui
            </button>
        </div>
        
        
    )

}


export default Input;
